import Phaser from "phaser"
import BossFinal from '../objects/Boss'
import BossImagen from '../../assets/Boss.png'
import Bullet from '../../assets/bullet.png'
import Player from '../objects/Player'
export class BossFinalScene extends Phaser.Scene {
  constructor() {
    super({ key: 'bossFinal' }) // Nombre de la escena
  }

  preload() {
    // Cargar la imagen del jefe y las balas
    this.load.image('boss', BossImagen) // Cambia la ruta a tu imagen
    this.load.image('bullet', Bullet)
  }

  create() {
    // Crear el jugador
    this.player = new Player(this, 400, 300) // Asumiendo que tienes una clase Player similar a la del jugador regular

    // Crear al jefe final
    this.boss = new BossFinal(this, 800, 400) // Posición inicial del jefe

    this.cursors = this.input.keyboard.createCursorKeys()

    // Configurar colisiones entre las balas del jefe y el jugador
    this.physics.add.overlap(this.boss.projectiles, this.player, this.bossBulletHitPlayer, null, this)
  }

  update() {
    // Aquí puedes añadir lógica adicional para la escena del jefe si es necesario
    this.player.update(this.cursors) // Movimiento del jugador
  }

  bossBulletHitPlayer(player, bullet) {
    player.takeDamage(5) // El jugador recibe daño al ser impactado por una bala
    bullet.destroy() // Destruir la bala
  }
}
